import React, { useEffect, useState } from "react";
import NotesService from "../services/NotesService";
import "./NotesList.css";

const NotesList = () => {
  const [notes, setNotes] = useState([
    {
      id: 1,
      title: "First Note",
      body: "First Note Body",
      category: "Programming",
    },
    {
      id: 2,
      title: "Second Note",
      body: "Second Note Body",
      category: "Mathematic",
    },
    {
      id: 3,
      title: "Third Note",
      body: "Third Note Body",
      category: "Design",
    },
  ]);

  useEffect(() => {
    NotesService.allNotes()
      .then((response) => {
        console.log(response.data);
        setNotes(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <div className="note-list">
      <div style={{ display: "flex" }}>
        <h1>List of Notes</h1>
        <h3
          style={{
            backgroundColor: "#26d2d8",
            borderRadius: "25px",
            marginLeft: "8px",
            padding: "8px",
          }}
        >
          {notes.length}
        </h3>
      </div>
      {notes.map((note) => (
        <div className="note" key={note.id}>
          <p style={{ fontSize: "24px", fontWeight: "bold" }}>{note.title}</p>
          <p>{note.body}</p>
        </div>
      ))}
    </div>
  );
};

export default NotesList;
